			h: "РћђРќёРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќё\nРќѕРќЉРќЉРќЉРќѕРќЉРќЉРќЉРќЉРќЉРќЉРќЉРќЉРќЉРќЉРќёРќёРќЉРќѕРќѕРќЉРќѕ\nРќѕРќЉРќђРќђРќѕРќђРќђРќЉРќёРќђРќЉРќёРќђРќЉРќЉРќђРќђРќЉРќёРќёРќЉРќѕ\nРќѕРќЉРќЉРќЉРќђРќЉРќЉРќЉРќёРќёРќёРќёРќёРќЉРќЉРќѕРќѕРќЉРќђРќђРќЉРќѕ\nРћђРќђРќёРќёРќёРќёРќёРќђРћђРћђРћђРћђРћђРќђРќёРќёРќёРќёРќёРќёРќђ",

			i: "РаёРаёРаёРаёРаёРаёРаёРаёРБаРБцРБХРБХРБХРБХРБцРБцРБцРБђ\nРаёРаёРаёРаёРаёРБаРБЙРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБХРБє\nРаёРаёРаёРбђРБцРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РАё\nРаёРаёРбђРБйРБ┐РБ┐РА┐РаЏРаЅРаЅРаЅРаЅРаЅРаЅРаЅРаЅРаЏРа╗Рб┐РБ┐РБ┐РБиРАђ\nРаёРаёРБЙРБ┐РБ┐РаЈРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаўРБ┐РБ┐РБи\nРаёРаёРаЂРаЅРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРб╗РБ┐РБ┐РАЄ\nРаёРбаРБ»РАаРаъРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРб╣РБ┐РАЄ\nРаёРбИРБ┐РаЂРаёРаёРБаРАХРаЏРаЏРаиРБёРаёРаёРаёРаёРБаРБцРБцРаёРаёРаёРБ┐РАЄ\nРаёРаўРАЈРаёРаёРа░РБ┐РА┐Ра┐РаќРаХРб┐РаЄРаёРаёРБцРБцРБцРБђРаёРаёРаёРБ┐РАЄ\nРбИРбХРАЄРаёРаёРаёРаёРаѕРаёРаёРаёРаёРаёРаёРаёРаљРацРаёРаЅРаЃРаёРаёРБ┐РаЃ\nРаўРБЙРАЄРаёРаёРаёРаёРаёРаёРаёРбђРБ┤РБЄРаёРаёРаёРаёРаёРаёРаёРаёРаёРб┐РАє\nРаёРаІРаЂРаёРбђРБцРБёРаёРаёРаёРаИРБ┐РБ┐РАиРаХРаёРаёРаёРаёРаёРаёРа░\nРаёРаёРаёРаёРбИРА┐РаЪРаёРаёРАђРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаёРаё\nРаёРаёРаёРаёРБИРБиРАђРаёРаИРБ┐РБ┐Ра┐РаЪРаЏРа╗РадРаёРаёРаёРаёРаё\nРбђРБђРаёРБ╝РБ┐РБ┐РБ┐РБдРаёРаѕРа╗Ра┐РаХРаќРаёРаёРаёРаёРаёРаёРаё\nРБ┐РБ┐РАёРб╣РБ┐РБ┐РБ┐РБ┐РБдРАђРаёРаёРаёРаёРаёРаёРаёРаёРбђРаћ\nРБ┐РБ┐РБ┐РАюРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБХРБдРБцРБцРБ┤РБХРаЪРаЅ\nРБ┐РБ┐РБ┐РБ┐РАїРб┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РА┐РаЪРаЂ\nРБ┐РБ┐РБ┐РБ┐РБ┐РБєРаЎРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РаЪРаёРаёРбђРБХРАђ\nРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБДРБѕРбЏРаІРаЎРБ┐РБ┐РаёРаёРаёРБ╝РБ┐РБ┐РБё\nРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБиРБєРаёРаёРаёРаёРаёРбИРБ┐РБ┐РБ┐РБє\nРБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РБ┐РАђРаёРаёРаёРаёРаёРа╗РаЏРа╗Ра┐",

			j: "РћђРћђРћђРћђРћђРћђРћђРћђРћђРќёРћђРћђРћђРћђ\nРћђРћђРћђРћђРћђРћђРћђРќљРќѕРќїРћђРћђРћђРћђ\nРћђРћђРћђРќёРќёРќёРћђРќђРћђРќёРќёРќёРћђРћђ\nРћђРќёРќѕРќѕРќѕРќѕРќѕРќёРќѕРќѕРќѕРќѕРќѕРќё\nРќљРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќђРћђ\nРќљРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРћђРћђРћђ\nРћђРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќёРћђ\nРћђРћђРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќѕРќђ\nРћђРћђРћђРќђРќѕРќѕРќђРћђРќђРќѕРќѕРќђРћђРћђ\nРћђРћђРћђРћђРћђРћђРћђРћђРћђРћђРћђРћђРћђРћђ\nРќђРќљРќђРќѕРќљРћђРћђРћђРћђРќёРћђРћђРќёРќё\nРќѕРќљРќђРќђРќљРќѕРќљРќѕРќїРќљРќѕРќїРќїРќѕ\nРќѕРќљРћђРћђРќљРќљРќљРќёРќїРќљРќљРќїРќѕРќё",

			k: "РћѕРћѕРћѕРЋ▓РћѕРћѕРћѕРћѕРЋ▒\nРћѕРћѕРћѕРЋ▒РќћРќћРќћРќћРЋ▓\nРћѕРћѕРћЃРћѕРќЄРћѕРћѕРќЄРћѕРћЃ\nРЋГРЋ«РћБРћЂРћЂРћЂРћЂРћЂРћЂРћФРЋГРЋ«\nРћЃРћЃРћЃРћѕРћѕРћѕРћѕРћѕРћѕРћЃРћЃРћЃ\nРЋ░РЋ»РћЃРћѕРћѕРћѕРћѕРћѕРћѕРћЃРЋ░РЋ»\nРћѕРћѕРЋ░РћЊРћЈРћЂРћЂРћЊРћЈРЋ»\nРћѕРћѕРћѕРЋ░РЋ»РћѕРћѕРЋ░РЋ»",

			l: "РќѕРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќђРќѕ\nРќѕРќЉРќЉРЋдРћђРЋдРЋћРЋЌРЋдРћђРЋћРЋЌРЋћРЋЌРЋћРЋдРЋЌРЋћРЋЌРќЉРќЉРќѕ\nРќѕРќЉРќЉРЋЉРЋЉРЋЉРЋаРћђРЋЉРћђРЋЉРћђРЋЉРЋЉРЋЉРЋЉРЋЉРЋаРћђРќЉРќЉРќѕ\nРќѕРќЉРќЉРЋџРЋЕРЋЮРЋџРЋЮРЋџРЋЮРЋџРЋЮРЋџРЋЮРЋЕРћђРЋЕРЋџРЋЮРќЉРќЉРќѕ\nРќѕРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќёРќѕ",

			m: "РћђРћђРћђРќёРќёРћђРќёРќѕРќѕРќѕРќѕРќёРќљРќёРќёРќёРќї\nРћђРћђРќљРћђРћђРќѕРќѕРќѕРќѕРќђРќѕРќѕРќѕРќёРќѕРќёРќї\nРќљРћђРќїРћђРћђРќѕРќђРќїРћђРћђРќљРќђРќїРќђРќѕРќђ\nРћђРќђРћђРћђРћђРќїРћђРќїРћђРћђРќљРћђРќї\nРћђРћђРћђРћђРћђРќѕРћђРќѕРћђРћђРќљРќїРќѕ",

